import React from "react";

function About() {
  return (
    <div className="pageCard row">
      <div className="divHeightHalf pb-2 col-12 col-md-8 order-md-2">
        <p>
          Pet Friend.ly is a social network for pet lovers. Here you can see a
          lot of content about pets,{" "}
        </p>
      </div>
      <div className="divHeightHalf pb-2 col-12 col-md-4 order-md-1">
        <img
          className="petImgHeightHalf"
          src="http://placeimg.com/1920/1080/animals"
        ></img>
      </div>
    </div>
  );
}

export default About;
